import React from "react";
import item1 from "../img/item-1.png";
import item2 from "../img/item-2.png";
import item3 from "../img/item-3.png";
import item4 from "../img/item-4.png";
import item5 from "../img/item-5.png";
import item6 from "../img/item-6.png";
import item7 from "../img/item-7.png";
import item8 from "../img/item-8.png";
import item9 from "../img/item-9.png";
import TheItem from "./TheItem";
const itemPIC = [item1, item2, item3, item4, item5, item6, item7, item8, item9];
const Products = (props) => {
  return (
    <section className="items">
      <div className="container">
        <TheItem title="Gray T-shirt" pic={props.items[0].pic} />
        <TheItem title="Pink Sweater" pic={props.items[1]} />
        <TheItem title="Off-White Sneakers" pic={props.items[2]} />
        <TheItem title="Gray T-shirt" pic={props.items[3]} />
        <TheItem title="Pink Sweater" pic={props.items[4]} />
        <TheItem title="Off-White Sneakers" pic={props.items[5]} />
        <TheItem title="Gray T-shirt" pic={props.items[6]} />
        <TheItem title="Pink Sweater" pic={props.items[7]} />
        <TheItem title="Off-White Sneakers" pic={props.items[8]} />
      </div>
      <button>MORE PRODUCTS</button>
    </section>
  );
};

export default Products;
